package com.ats;

import org.apache.pdfbox.pdmodel.PDDocument;
import org.apache.pdfbox.text.PDFTextStripper;
import org.junit.jupiter.api.Test;

import java.io.ByteArrayInputStream;
import java.io.File;
import java.io.IOException;
import java.util.Base64;

import static org.junit.jupiter.api.Assertions.*;

public class PDFReaderTest {

    @Test
    void readFromFilePath() {
        String message = "IMIE NAZWISKO \r\nOPIS UMIEJETNOSCI ITD ITP. … \r\n";
        String text = "";
        try {
            String pdfFilePath = "C:\\java_projects\\ats-springBoot-backend\\demo\\src\\main\\resources\\CV_TEST1.pdf";
            PDDocument document = PDDocument.load(new File(pdfFilePath));
            PDFTextStripper pdfTextStripper = new PDFTextStripper();
            text = pdfTextStripper.getText(document);
            document.close();
        } catch (IOException e) {
            e.printStackTrace();
        }
        assertTrue(message.length() != 0);
        assertEquals(text, message);
    }

    @Test
    void readFromBase64Bytes() {
        String message = "IMIE NAZWISKO \r\nOPIS UMIEJETNOSCI ITD ITP. … \r\n";
        String text = "";
        try {
            String encodedString = "";
            byte[] decodedBytes = Base64.getDecoder().decode(encodedString);
            ByteArrayInputStream byteArrayInputStream = new ByteArrayInputStream(decodedBytes);
            PDDocument document = PDDocument.load(byteArrayInputStream);
            PDFTextStripper pdfTextStripper = new PDFTextStripper();
            text = pdfTextStripper.getText(document);
            System.out.println(text);
            document.close();
        } catch (IOException e) {
            e.printStackTrace();
        }
        assertTrue(message.length() != 0);
        assertEquals(text, message);
    }

}
